import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import './template.css';

export default function Template() {
  const [prompt, setPrompt] = useState('');
  const [characterName, setCharacterName] = useState('');
  const [numImages, setNumImages] = useState(4);

  const [isAuthorized, setIsAuthorized] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const modalRef = useRef(null);

  const navigate = useNavigate();

  // Проверка авторизации при загрузке
  useEffect(() => {
    fetch('http://storysight.ru/api/auth/me', {
      credentials: 'include',
    })
      .then(res => res.ok ? res.json() : Promise.reject())
      .then(() => {
        setIsAuthorized(true);
        setShowModal(false);
      })
      .catch(() => {
        setIsAuthorized(false);
        setShowModal(true);
      });
  }, []);

  // Обработчик Telegram авторизации
  useEffect(() => {
    window.onTelegramAuth = (user) => {
      fetch('http://storysight.ru/api/auth/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        credentials: 'include',
        body: JSON.stringify(user),
      })
        .then(res => {
          if (res.ok) {
            setIsAuthorized(true);
            setShowModal(false);
          } else {
            alert('Ошибка авторизации через Telegram');
          }
        })
        .catch((err) => {
          console.error('Auth error', err);
          alert('Ошибка авторизации через Telegram');
        });
    };

    return () => {
      window.onTelegramAuth = null;
    };
  }, []);

  // Вставка Telegram-виджета
  useEffect(() => {
    if (showModal && modalRef.current) {
      modalRef.current.innerHTML = '';

      const existingScript = document.querySelector('script[src="https://telegram.org/js/telegram-widget.js?22"]');
      if (existingScript) existingScript.remove();

      const script = document.createElement('script');
      script.src = 'https://telegram.org/js/telegram-widget.js?22';
      script.async = true;
      script.setAttribute('data-telegram-login', 'zavod_worker_bot');
      script.setAttribute('data-size', 'large');
      script.setAttribute('data-userpic', 'false');
      script.setAttribute('data-onauth', 'onTelegramAuth(user)');
      script.setAttribute('data-request-access', 'write');

      modalRef.current.appendChild(script);
    }
  }, [showModal]);

  const handleGenerate = async () => {
    if (!prompt.trim() || !characterName.trim()) {
      alert('Введите все поля');
      return;
    }

    try {
      const response = await fetch('http://storysight.ru/api/generate-comic', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        credentials: 'include',
        body: JSON.stringify({
          prompt,
          character_name: characterName,
          num_images: numImages,
        }),
      });

      const data = await response.json();

      if (response.ok) {
        const images = data.images.map(img => `data:image/webp;base64,${img}`);
        navigate('/result-main', {
          state: {
            images,
            storyline: data.storyline,
            prompts: data.prompts,
          },
        });
      } else {
        alert(data.error || 'Ошибка генерации');
      }
    } catch (err) {
      console.error(err);
      alert('Ошибка соединения');
    }
  };

  if (isAuthorized === null) return <div className="template-container">Загрузка...</div>;

  return (
    <div className="template-container">
      <h1 className="template-title">Генерация по шаблону</h1>

      <label className="template-label">Краткий сюжет на русском</label>
      <textarea
        className="template-textarea"
        value={prompt}
        onChange={(e) => setPrompt(e.target.value)}
      />

      <label className="template-label">Имя или тип персонажа</label>
      <input
        className="template-input"
        type="text"
        value={characterName}
        onChange={(e) => setCharacterName(e.target.value)}
      />

      <label className="template-label">
        Количество изображений: {numImages}
      </label>
      <input
        type="range"
        min={1}
        max={8}
        value={numImages}
        onChange={(e) => setNumImages(Number(e.target.value))}
        className="template-slider"
      />

      <div className="button-row">
        <button className="btn btn-gray" onClick={() => navigate('/create-choice')}>
          Назад
        </button>
        <button
          className="btn btn-purple"
          onClick={handleGenerate}
        >
          Сгенерировать
        </button>
      </div>

      {showModal && (
        <div className="modal-overlay" onClick={() => setShowModal(false)}>
          <div
            className="modal"
            onClick={(e) => e.stopPropagation()}
            role="dialog"
            aria-modal="true"
            aria-labelledby="modal-title"
          >
            <h2 id="modal-title">Вход через Telegram</h2>
            <p>Пожалуйста, войдите, чтобы продолжить</p>
            <div ref={modalRef} />
            <button className="btn btn-gray" onClick={() => setShowModal(false)}>
              Закрыть
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
